import { countries } from "./data";

// import your component here  and use it in the App.js file or wherever you want to display this data, like so: <Country />
function Country() {
  console.log(countries);
  return (
    <>
      <h1 className="country">
        {countries.map(country => <h2>
          {country.name}
          <ul>
            {country.cities.map(city => <li>{city}</li>)}
          </ul>
        </h2>)}

      </h1>
    </>
  );
}

export default Country;
